import ExpenseItem from "./components/ExpenseItem"

function App() {

  const expenses = [
    {'name': 'insurance', 'price': 200, 'date': Date(2000, 11, 15)},
    {'name': 'petrol', 'price': 100, 'date': Date(2000, 11, 16)},
    {'name': 'service', 'price': 300, 'date': Date(2000, 11, 17)}
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also visible.</p>
      <ExpenseItem title={expenses[0].title} price={expenses[0].price} date={expenses[0].date.toISOString()}></ExpenseItem>
    </div>
  );
}

export default App;
